import React from "react";
import { makeStyles, useTheme } from "@material-ui/core/styles";
import Card from "@material-ui/core/Card";
import CardContent from "@material-ui/core/CardContent";
import CardActions from "@material-ui/core/CardActions";
import CardMedia from "@material-ui/core/CardMedia";
import Typography from "@material-ui/core/Typography";
import Chip from "@material-ui/core/Chip";
import docAlex from "./img/results/docAlex.png";
import FavoriteIcon from "@material-ui/icons/Favorite";
import IconButton from "@material-ui/core/IconButton";

const useStyles = makeStyles((theme) => ({
  root: {
    display: "100%",
  },
  details: {
    display: "flex",
    flexDirection: "column",
  },
  content: {
    flex: "1 0 auto",
  },
  cover: {
    width: "50%",
    margin: 10,
    backgroundSize: "contain",
  },
  controls: {
    display: "flex",
    alignItems: "center",
    paddingLeft: theme.spacing(1),
    paddingBottom: theme.spacing(1),
  },
}));

export default function MediaControlCard() {
  const classes = useStyles();
  const theme = useTheme();

  return (
    <Card className={classes.root}>
      <CardMedia className={classes.cover} image={docAlex} />

      <div className={classes.details}>
        <CardContent className={classes.content}>
          <Typography component="h5" variant="h5" color="primary">
            Dr. Alex Leow
          </Typography>
          <Typography variant="subtitle1" color="textSecondary">
            Specialty: <span>Gastroenterology</span>
          </Typography>
          <Typography variant="subtitle1" color="textSecondary">
            Hospital: <span>Pantai Hospital Kuala Lumpur</span>
          </Typography>
          <Typography variant="subtitle1" color="textSecondary">
            Languages: <span>English, Malay, Mandarin, Cantonese</span>
          </Typography>
          <br></br>
          <Chip color="secondary" size="small" label="Private"></Chip>
        </CardContent>
        <CardActions>
          <IconButton aria-label="add to favorites">
            <FavoriteIcon />
          </IconButton>
        </CardActions>
      </div>
    </Card>
  );
}
